function signature(httpOpts,ak,sk) {
  httpOpts.headers["X-Ca-Key"] = ak;
  httpOpts.headers["X-Ca-Signature-Headers"] = "x-ca-key";

  var str = "";
  str += `${httpOpts.method}\n`;
  str += `${httpOpts.headers["Accept"]}\n`;
  str += `${httpOpts.headers["Content-MD5"]}\n`;
  str += `${httpOpts.headers["Content-Type"]}\n`;
  str += `${httpOpts.headers["Date"]}\n`;
  str += `x-ca-key:${httpOpts.headers["X-Ca-Key"]}\n`;
  str += `${httpOpts.path}`;
  console.log("[before sign]");
  console.log(str);
  var s = crypto
    .createHmac("sha256", sk)
    .update(str, "utf8")
    .digest("base64");
  console.log("[after sign]");
  console.log(s);
  httpOpts.headers["X-Ca-Signature"] = s;
}

function $http(options) {
  return $db
    .find("CONFIG", { _id: "$config_id" })
    .then((res) => {
      return (configCache = res[0] || {});
    })
    .then((config) => {
      var mediaPlatformAddress = config.mediaPlatformAddress || "";
      // console.log(mediaPlatformAddress, options.url);
      var ip_port = mediaPlatformAddress.split(":");
      var httpOpts = {
        hostname: ip_port[0],
        port: ip_port[1] || 443, //443
        path: options.url,
        method: (options.type || "POST").toUpperCase(),
        rejectUnauthorized: false,
      };
      var bodyData = JSON.stringify(options.data);
      //degist body
      var contentMd5 = crypto
        .createHash("md5")
        .update(bodyData || "")
        .digest("base64");
      //headers
      httpOpts.headers = {
        "User-Agent": "PostmanRuntime/7.25.0",
        Accept: "*/*",
        "Content-MD5": contentMd5,
        "Content-Type": "application/json",
        Date: Date.now(),
      };
      //sign
      signature(httpOpts,config.hikAK,config.hikSK);

      return new Promise((resolve, reject) => {
        var req = https.request(httpOpts, function(res) {
          res.setEncoding("utf-8");
          var buff = "";
          res.on("data", function(chunk) {
            buff += chunk;
          });
          res.on("end", function(chunk) {
            // console.log("end:" + buff);
            try {
              var data = JSON.parse(buff);
              if (data && data.code == "0") {
                resolve(data.data);
              } else if (data) {
                reject(`${data.code}:${ERR_CODE[data.code] || "未知错误"}`);
              } else {
                reject("未知错误");
              }
            } catch (e) {
              resolve(buff);
            }
          });
        });
        req.setTimeout(5 * 1000);
        if (bodyData) {
          req.write(bodyData);
        }
        req.on("error", function(e) {
          reject(e);
        });
        req.write("");
        req.end();
      });
    });
}

